import React from 'react';
import Filter from './filter';

class Filters extends React.Component {
    constructor (props) {
        super (props);
    }
    render () {
        return (
            <div>
                <Filter species={this.props.species}></Filter>
            </div>
        )
    }
}

export default Filters;
